import{_ as i,o as r,c as g,b as n,d as p,a as o,f as t,r as e}from"./app.75b474e0.js";const l={},a=o('<h1 id="\u9700\u6C42\u5DE5\u7A0B" tabindex="-1"><a class="header-anchor" href="#\u9700\u6C42\u5DE5\u7A0B" aria-hidden="true">#</a> \u9700\u6C42\u5DE5\u7A0B</h1><p>\u8F6F\u4EF6\u9700\u6C42\u662F\u6307\u7528\u6237\u5BF9\u7CFB\u7EDF\u5728\u529F\u80FD\u3001\u884C\u4E3A\u3001\u6027\u80FD\u3001\u8BBE\u8BA1\u7EA6\u675F\u7B49\u65B9\u9762\u7684\u671F\u671B\u3002 \u8F6F\u4EF6\u9700\u6C42\u662F\u6307\u7528\u6237\u89E3\u51B3\u95EE\u9898\u6216\u8FBE\u5230\u76EE\u6807\u6240\u9700\u7684\u6761\u4EF6\u6216\u80FD\u529B\uFF0C\u662F\u7CFB\u7EDF\u6216\u7CFB\u7EDF\u90E8\u4EF6\u8981\u6EE1\u8DB3\u5408\u540C\u3001\u6807\u51C6\u3001\u89C4\u8303\u6216\u5176\u4ED6\u6B63\u5F0F\u89C4\u5B9A\u6587\u6863\u6240\u9700\u5177\u6709\u7684\u6761\u4EF6\u6216\u80FD\u529B\uFF0C\u4EE5\u53CA\u53CD\u6620\u8FD9\u4E9B\u6761\u4EF6\u6216\u80FD\u529B\u7684\u6587\u6863\u8BF4\u660E\u3002</p><p>\u9700\u6C42\u5F00\u53D1\uFF1A</p><ul><li>\u9700\u6C42\u83B7\u53D6</li><li>\u9700\u6C42\u5206\u6790</li><li>\u9700\u6C42\u5B9A\u4E49\uFF08\u9700\u6C42\u89C4\u683C\u8BF4\u660E\u4E66\uFF09</li><li>\u9700\u6C42\u9A8C\u8BC1</li></ul><p>\u9700\u6C42\u7BA1\u7406:</p><ul><li>\u53D8\u66F4\u63A7\u5236</li><li>\u7248\u672C\u63A7\u5236</li><li>\u9700\u6C42\u8DDF\u8E2A</li><li>\u9700\u6C42\u72B6\u6001\u8DDF\u8E2A</li></ul><p>\u9700\u6C42\u5206\u7C7B\uFF1A</p><ul><li>\u4E1A\u52A1\u9700\u6C42(\u6574\u4F53\u5168\u5C40)</li><li>\u7528\u6237\u9700\u6C42(\u7528\u6237\u89C6\u89D2)</li><li>\u7CFB\u7EDF\u9700\u6C42(\u8BA1\u7B97\u673A\u5316)</li><li></li><li>\u57FA\u672C\u9700\u6C42(\u660E\u793A\uFF0C\u5E38\u89C4\u9700\u6C42)</li><li>\u671F\u671B\u9700\u6C42(\u9690\u542B)</li><li>\u5174\u594B\u9700\u6C42(\u591A\u4F59)</li></ul><h1 id="\u9700\u6C42\u83B7\u53D6" tabindex="-1"><a class="header-anchor" href="#\u9700\u6C42\u83B7\u53D6" aria-hidden="true">#</a> \u9700\u6C42\u83B7\u53D6</h1><p><strong>\u7528\u6237\u8BBF\u8C08</strong>\uFF1A\u7528\u6237\u8BBF\u8C08\u662F\u6700\u57FA\u672C\u7684\u4E00\u79CD\u9700\u6C42\u83B7\u53D6\u624B\u6BB5\uFF0C\u5176\u5F62\u5F0F\u5305\u62EC\u7ED3\u6784\u5316\u548C\u975E\u7ED3\u6784\u5316\u4E24\u79CD\u3002\u7528\u6237\u8BBF\u8C08\u662F\u901A\u8FC71\u5BF91\uFF08\u62161\u5BF92\uFF0C1\u5BF93\uFF09\u7684\u5F62\u5F0F\u4E0E\u7528\u6237\u9762\u5BF9\u9762\u8FDB\u884C\u6C9F\u901A\uFF0C\u4EE5\u83B7\u53D6\u7528\u6237\u9700\u6C42\u3002\u7528\u6237\u8BBF\u8C08\u5177\u6709\u826F\u597D\u7684\u7075\u6D3B\u6027\uFF0C\u6709\u8F83\u5BBD\u5E7F\u7684\u5E94\u7528\u8303\u56F4\u3002\u4F46\u662F\uFF0C\u4E5F\u5B58\u5728\u7740\u8BB8\u591A\u56F0\u96BE\uFF0C\u4F8B\u5982\uFF0C\u7528\u6237\u7ECF\u5E38\u8F83\u5FD9\uFF0C\u96BE\u4EE5\u5B89\u6392\u65F6\u95F4\uFF1B\u9762\u8C08\u65F6\u4FE1\u606F\u91CF\u5927\uFF0C\u8BB0\u5F55\u8F83\u4E3A\u56F0\u96BE\uFF1B\u6C9F\u901A\u9700\u8981\u5F88\u591A\u6280\u5DE7\uFF0C\u540C\u65F6\u9700\u8981\u7CFB\u7EDF\u5206\u6790\u5E08\u5177\u6709\u8DB3\u591F\u7684\u9886\u57DF\u77E5\u8BC6\u7B49\u3002\u53E6\u5916\uFF0C\u5728\u8BBF\u8C08\u65F6\uFF0C\u8FD8\u53EF\u80FD\u4F1A\u9047\u5230\u4E00\u4E9B\u5BF9\u4E8E\u4F01\u4E1A\u6765\u8BF4\u6BD4\u8F83\u673A\u5BC6\u548C\u654F\u611F\u7684\u8BDD\u9898\u3002\u56E0\u6B64\uFF0C\u8FD9\u770B\u4F3C\u7B80\u5355\u7684\u6280\u672F\uFF0C\u4E5F\u9700\u8981\u7CFB\u7EDF\u5206\u6790\u5E08\u5177\u6709\u4E30\u5BCC\u7684\u7ECF\u9A8C\u548C\u8F83\u5F3A\u7684\u6C9F\u901A\u80FD\u529B\u3002</p><p><strong>\u91C7\u6837</strong>\u662F\u6307\u4ECE\u79CD\u7FA4\u4E2D\u7CFB\u7EDF\u5730\u9009\u51FA\u6709\u4EE3\u8868\u6027\u7684\u6837\u672C\u96C6\u7684\u8FC7\u7A0B\uFF0C\u901A\u8FC7\u8BA4\u771F\u7814\u7A76\u6240\u9009\u51FA\u7684\u6837\u672C\u96C6\uFF0C\u53EF\u4EE5\u4ECE\u6574\u4F53\u4E0A\u63ED\u793A\u79CD\u7FA4\u7684\u6709\u7528\u4FE1\u606F\u3002\u5BF9\u4E8E\u4FE1\u606F\u7CFB\u7EDF\u7684\u5F00\u53D1\u800C\u8A00\uFF0C\u73B0\u6709\u7CFB\u7EDF\u7684\u6587\u6863\uFF08\u6587\u4EF6\uFF09\u5C31\u662F\u91C7\u6837\u79CD\u7FA4\u3002\u5F53\u5F00\u59CB\u5BF9\u4E00\u4E2A\u7CFB\u7EDF\u505A\u9700\u6C42\u5206\u6790\u65F6\uFF0C\u67E5\u770B\u73B0\u6709\u7CFB\u7EDF\u7684\u6587\u6863\u662F\u5BF9\u7CFB\u7EDF\u6709\u521D\u6B65\u4E86\u89E3\u7684\u6700\u597D\u65B9\u6CD5\u3002\u4F46\u662F\uFF0C\u7CFB\u7EDF\u5206\u6790\u5E08\u5E94\u8BE5\u67E5\u770B\u54EA\u4E9B\u7C7B\u578B\u7684\u6587\u6863\uFF0C\u5F53\u6587\u6863\u7684\u6570\u636E\u5E9E\u5927\uFF0C\u6CD5\u2014\u2014\u7814\u7A76\u65F6\uFF0C\u5C31\u9700\u8981\u4F7F\u7528\u91C7\u6837\u6280\u672F\u9009\u51FA\u6709\u4EE3\u8868\u6027\u7684\u6570\u636E\u3002\u91C7\u6837\u6280\u672F\u4E0D\u4EC5\u53EF\u4EE5\u7528\u4E8E\u6536\u96C6\u6570\u636E\uFF0C\u8FD8\u53EF\u4EE5\u7528\u4E8E\u91C7\u96C6\u8BBF\u8C08\u7528\u6237\u6216\u8005\u662F\u91C7\u96C6\u89C2\u5BDF\u7528\u6237\u3002\u5728\u5BF9\u4EBA\u5458\u8FDB\u884C\u91C7\u6837\u65F6\uFF0C\u4E0A\u9762\u4ECB\u7ECD\u7684\u91C7\u6837\u6280\u672F\u540C\u6837\u9002\u7528\u3002\u901A\u8FC7\u91C7\u6837\u6280\u672F\uFF0C\u9009\u62E9\u90E8\u5206\u800C\u4E0D\u662F\u9009\u62E9\u79CD\u7FA4\u7684\u5168\u90E8\uFF0C\u4E0D\u4EC5\u52A0\u5FEB\u4E86\u6570\u636E\u6536\u96C6\u7684\u8FC7\u7A0B\uFF0C\u800C\u4E14\u63D0\u9AD8\u4E86\u6548\u7387\uFF0C\u4ECE\u800C\u964D\u4F4E\u4E86\u5F00\u53D1\u6210\u672C\u3002\u53E6\u5916\uFF0C\u91C7\u6837\u6280\u672F\u4F7F\u7528\u4E86\u6570\u7406\u7EDF\u8BA1\u539F\u7406\uFF0C\u80FD\u51CF\u5C11\u6570\u636E\u6536\u96C6\u7684\u504F\u5DEE\u3002\u4F46\u662F\uFF0C\u7531\u4E8E\u91C7\u6837\u6280\u672F\u57FA\u4E8E\u7EDF\u8BA1\u5B66\u539F\u7406\uFF0C\u6837\u672C\u89C4\u6A21\u7684\u786E\u5B9A\u4F9D\u8D56\u4E8E\u671F\u671B\u7684\u53EF\u4FE1\u5EA6\u548C\u5DF2\u6709\u7684\u5148\u9A8C\u77E5\u8BC6\uFF0C\u5F88\u5927\u7A0B\u5EA6\u4E0A\u53D6\u51B3\u4E8E\u7CFB\u7EDF\u5206\u6790\u5E08\u7684\u4E3B\u89C2\u56E0\u7D20\uFF0C\u5BF9\u7CFB\u7EDF\u5206\u6790\u5E08\u4E2A\u4EBA\u7684\u7ECF\u9A8C\u548C\u80FD\u529B\u4F9D\u8D56\u6027\u5F88\u5F3A\uFF0C\u8981\u6C42\u7CFB\u7EDF\u5206\u6790\u5E08\u5177\u6709\u8F83\u9AD8\u7684\u6C34\u5E73\u548C\u4E30\u5BCC\u7684\u7ECF\u9A8C\u3002</p><p><strong>\u8054\u5408\u9700\u6C42\u8BA1\u5212</strong>\uFF1A\u4E3A\u4E86\u63D0\u9AD8\u9700\u6C42\u83B7\u53D6\u7684\u6548\u7387\uFF0C\u8D8A\u6765\u8D8A\u591A\u7684\u4F01\u4E1A\u503E\u5411\u4E8E\u4F7F\u7528\u5C0F\u7EC4\u5DE5\u4F5C\u4F1A\u8BAE\u6765\u4EE3\u66FF\u5927\u91CF\u72EC\u7ACB\u7684\u8BBF\u8C08\u3002\u8054\u5408\u9700\u6C42\u8BA1\u5212\uFF08Joint Requirement Planning\uFF0CJRP\uFF09\u662F\u4E00\u4E2A\u901A\u8FC7\u9AD8\u5EA6\u7EC4\u7EC7\u7684\u7FA4\u4F53\u4F1A\u8BAE\u6765\u5206\u6790\u4F01\u4E1A\u5185\u7684\u95EE\u9898\u5E76\u83B7\u53D6\u9700\u6C42\u7684\u8FC7\u7A0B\uFF0C\u5B83\u662F\u8054\u5408\u5E94\u7528\u5F00\u53D1\uFF08Joint Application Development\uFF0CJAD\uFF09\u7684\u4E00\u90E8\u5206\u3002</p><h1 id="\u9700\u6C42\u5206\u7C7B" tabindex="-1"><a class="header-anchor" href="#\u9700\u6C42\u5206\u7C7B" aria-hidden="true">#</a> \u9700\u6C42\u5206\u7C7B</h1><p>\u7B80\u5355\u5730\u8BF4\uFF0C\u8F6F\u4EF6\u9700\u6C42\u5C31\u662F\u7CFB\u7EDF\u5FC5\u987B\u5B8C\u6210\u7684\u4E8B\u4EE5\u53CA\u5FC5\u987B\u5177\u5907\u7684\u54C1\u8D28\u3002\u9700\u6C42\u662F\u591A\u5C42\u6B21\u7684\uFF0C\u5305\u62EC\u4E1A\u52A1\u9700\u6C42\u3001\u7528\u6237\u9700\u6C42\u548C\u7CFB\u7EDF\u9700\u6C42\uFF0C\u8FD9\u4E09\u4E2A\u4E0D\u540C\u5C42\u6B21\u4ECE\u76EE\u6807\u5230\u5177\u4F53\uFF0C\u4ECE\u6574\u4F53\u5230\u5C40\u90E8\uFF0C\u4ECE\u6982\u5FF5\u5230\u7EC6\u8282\u3002 \uFF081\uFF09\u4E1A\u52A1\u9700\u6C42\u3002\u4E1A\u52A1\u9700\u6C42\u662F\u6307\u53CD\u6620\u4F01\u4E1A\u6216\u5BA2\u6237\u5BF9\u7CFB\u7EDF\u9AD8\u5C42\u6B21\u7684\u76EE\u6807\u8981\u6C42\uFF0C\u901A\u5E38\u6765\u81EA\u9879\u76EE\u6295\u8D44\u4EBA\u3001\u8D2D\u4E70\u4EA7\u54C1\u7684\u5BA2\u6237\u3001\u5BA2\u6237\u5355\u4F4D\u7684\u7BA1\u7406\u4EBA\u5458\u3001\u5E02\u573A\u8425\u9500\u90E8\u95E8\u6216\u4EA7\u54C1\u7B56\u5212\u90E8\u95E8\u7B49\u3002\u901A\u8FC7\u4E1A\u52A1\u9700\u6C42\u53EF\u4EE5\u786E\u5B9A\u9879\u76EE\u89C6\u56FE\u548C\u8303\u56F4\u3002 \uFF082\uFF09\u7528\u6237\u9700\u6C42\u3002\u7528\u6237\u9700\u6C42\u63CF\u8FF0\u7684\u662F\u7528\u6237\u7684\u5177\u4F53\u76EE\u6807\uFF0C\u6216\u7528\u6237\u8981\u6C42\u7CFB\u7EDF\u5FC5\u987B\u80FD\u5B8C\u6210\u7684\u4EFB\u52A1\u3002\u4E5F\u5C31\u662F\u8BF4\uFF0C\u7528\u6237\u9700\u6C42\u63CF\u8FF0\u4E86\u7528\u6237\u80FD\u4F7F\u7528\u7CFB\u7EDF\u6765\u505A\u4E9B\u4EC0\u4E48\u3002\u901A\u5E38\u91C7\u53D6\u7528\u6237\u8BBF\u8C08\u548C\u95EE\u5377\u8C03\u67E5\u7B49\u65B9\u5F0F\uFF0C\u5BF9\u7528\u6237\u4F7F\u7528\u7684\u573A\u666F\uFF08scenarios\uFF09\u8FDB\u884C\u6574\u7406\uFF0C\u4ECE\u800C\u5EFA\u7ACB\u7528\u6237\u9700\u6C42 \uFF083\uFF09\u7CFB\u7EDF\u9700\u6C42\u3002\u7CFB\u7EDF\u9700\u6C42\u662F\u4ECE\u7CFB\u7EDF\u7684\u89D2\u5EA6\u6765\u8BF4\u660E\u8F6F\u4EF6\u7684\u9700\u6C42\uFF0C\u5305\u62EC\u529F\u80FD\u9700\u6C42\u3001\u975E\u529F\u80FD\u9700\u6C42\u548C\u8BBE\u8BA1\u7EA6\u675F\u7B49\u3002</p><p>\u7BA1\u7406\u7EF4\u5EA6\uFF1A</p><ul><li>\u57FA\u672C\u9700\u6C42</li><li>\u671F\u671B\u9700\u6C42</li><li>\u5174\u594B\u9700\u6C42</li></ul><h1 id="\u9700\u6C42\u5206\u6790-sa" tabindex="-1"><a class="header-anchor" href="#\u9700\u6C42\u5206\u6790-sa" aria-hidden="true">#</a> \u9700\u6C42\u5206\u6790 SA</h1><p><strong>\u9700\u6C42\u5206\u6790</strong>\u662F\u4E00\u79CD\u8F6F\u4EF6\u5DE5\u7A0B\u6D3B\u52A8\uFF0C\u5B83\u5728\u7CFB\u7EDF\u7EA7\u8F6F\u4EF6\u5206\u914D\u548C\u8F6F\u4EF6\u8BBE\u8BA1\u95F4\u8D77\u5230\u6865\u6881\u7684\u4F5C\u7528\uFF0C\u9700\u6C42\u5206\u6790\u4F7F\u5F97\u7CFB\u7EDF\u5DE5\u7A0B\u5E08\u80FD\u591F\u523B\u753B\u51FA\u8F6F\u4EF6\u7684\u529F\u80FD\u548C\u6027\u80FD\uFF0C\u6307\u660E\u8F6F\u4EF6\u548C\u5176\u4ED6\u7CFB\u7EDF\u5143\u7D20\u7684\u63A5\u53E3\uFF0C\u5E76\u5EFA\u7ACB\u8F6F\u4EF6\u5FC5\u987B\u6EE1\u8DB3\u7684\u7EA6\u675F\u3002 \u9700\u6C42\u5206\u6790\u5141\u8BB8\u7CFB\u7EDF\u5206\u6790\u5E08\u7EC6\u5316\u8F6F\u4EF6\u7684\u5206\u89E3\uFF0C\u5E76\u5EFA\u7ACB\u5C06\u88AB\u8F6F\u4EF6\u5904\u7406\u7684<strong>\u6570\u636E\u3001\u529F\u80FD\u548C\u884C\u4E3A\u6A21\u578B</strong>\u3002\u6700\u540E\uFF0C\u9700\u6C42\u89C4\u7EA6\u4E3A\u5F00\u53D1\u8005\u548C\u5BA2\u6237\u63D0\u4F9B\u4E86\u8F6F\u4EF6\u5F00\u53D1\u5B8C\u6210\u540E\u8D28\u91CF\u8BC4\u4F30\u7684\u4F9D\u636E\u3002 \u9700\u6C42\u5206\u6790\u4E3A\u8F6F\u4EF6\u8BBE\u8BA1\u5E08\u63D0\u4F9B\u4E86\u53EF\u88AB\u7FFB\u8BD1\u6210\u6570\u636E\u3001\u67B6\u6784\u3001\u754C\u9762\u548C\u8FC7\u7A0B\u8BBE\u8BA1\u7684\u6A21\u578B\uFF0C \u9700\u6C42\u5206\u6790\u7684\u4EFB\u52A1\u662F\u53D1\u73B0\u3001\u6C42\u7CBE\u3001\u5EFA\u6A21\u548C\u89C4\u7EA6\u7684\u8FC7\u7A0B\uFF0C\u5305\u62EC\u8BE6\u7EC6\u5730\u7EC6\u5316\u7531\u7CFB\u7EDF\u5DE5\u7A0B\u5E08\u5EFA\u7ACB\u5E76\u5728\u8F6F\u4EF6\u9879\u76EE\u8BA1\u5212\u4E2D\u660E\u786E\u7684\u8F6F\u4EF6\u8303\u56F4\uFF0C\u521B\u5EFA\u6240\u9700\u6570\u636E\u3001\u4FE1\u606F\u548C\u63A7\u5236\u6D41\u53CA\u64CD\u4F5C\u884C\u4E3A\u7684\u6A21\u578B\uFF0C\u6B64\u5916\uFF0C\u8FD8\u8981\u5206\u6790\u53EF\u9009\u62E9\u7684\u89E3\u51B3\u65B9\u6848\uFF0C\u5E76\u5C06\u5B83\u4EEC\u5206\u914D\u5230\u5404\u8F6F\u4EF6\u5143\u7D20\u4E2D\u53BB\u3002 \u9700\u8981\u6CE8\u610F\u7684\u662F\uFF0C\u5728\u9700\u6C42\u5206\u6790\u9636\u6BB5\u8981\u5F97\u5230\u8BE6\u7EC6\u7684\u89C4\u7EA6\u662F\u4E0D\u53EF\u80FD\u7684\u3002\u5BA2\u6237\u53EF\u80FD\u5E76\u4E0D\u80FD\u7CBE\u786E\u5730\u80AF\u5B9A\u9700\u8981\u4EC0\u4E48\uFF0C\u5F00\u53D1\u8005\u53EF\u80FD\u4E0D\u80FD\u80AF\u5B9A\u53EF\u7528\u4EC0\u4E48\u7279\u5B9A\u7684\u65B9\u6CD5\u6765\u9002\u5F53\u5730\u5B8C\u6210\u529F\u80FD\u548C\u6027\u80FD\u3002</p><p><img src="https://img-blog.csdnimg.cn/20210513150253902.png?" alt="img"></p><p><strong>DFD \u6570\u636E\u6D41\u56FE</strong></p><p>\u6570\u636E\u6D41\u56FEDFD\u662FSA\u65B9\u6CD5\u4E2D\u7684\u91CD\u8981\u5DE5\u5177\uFF0C\u662F<strong>\u8868\u8FBE\u7CFB\u7EDF\u5185\u90E8\u6570\u636E\u7684\u6D41\u52A8\u5E76\u901A\u8FC7\u6570\u636E\u6D41\u63CF\u8FF0\u7CFB\u7EDF\u529F\u80FD</strong>\u7684\u4E00\u79CD\u65B9\u6CD5\u3002 DFD\u8FD8\u53EF\u88AB\u8BA4\u4E3A\u662F\u4E00\u4E2A\u7CFB\u7EDF\u6A21\u578B\uFF0C\u5728\u4FE1\u606F\u7CFB\u7EDF\u5F00\u53D1\u4E2D\uFF0C\u5982\u679C\u91C7\u7528\u7ED3\u6784\u5316\u65B9\u6CD5\uFF0C\u5219\u4E00\u822C\u5C06DFD\u4F5C\u4E3A\u9700\u6C42\u89C4\u683C\u8BF4\u660E\u4E66\u7684\u4E00\u4E2A\u7EC4\u6210\u90E8\u5206\u3002\u7528\u4F8B\u6A21\u578B\u63CF\u8FF0\u4E86\u4E00\u7EC4\u7528\u4F8B\u3001\u53C2\u4E0E\u8005\u53CA\u5B83\u4EEC\u4E4B\u95F4\u7684\u5173\u7CFB\u3002 \u901A\u5E38\u4F7F\u7528<strong>\u6570\u636E\u5B57\u5178</strong>\u4F5C\u4E3A\u8BE5\u5DE5\u5177\u7684\u8865\u5145\u8BF4\u660E\u3002</p><p>\uFF081\uFF09DFD\u662F\u7406\u89E3\u548C\u8868\u8FBE\u7528\u6237\u9700\u6C42\u7684\u5DE5\u5177\uFF0C\u662F\u9700\u6C42\u5206\u6790\u7684\u624B\u6BB5\u3002\u7531\u4E8EDFD\u7B80\u660E\u6613\u61C2\uFF0C\u4E0D\u9700\u8981\u4EFB\u4F55\u8BA1\u7B97\u673A\u4E13\u4E1A\u77E5\u8BC6\u5C31\u53EF\u4EE5\u7406\u89E3\u5B83\uFF0C\u56E0\u6B64\uFF0C\u7CFB\u7EDF\u5206\u6790\u5E08\u53EF\u4EE5\u901A\u8FC7DFD\u4E0E\u7528\u6237\u8FDB\u884C\u4EA4\u6D41\u3002 \uFF082\uFF09DFD\u6982\u62EC\u5730\u63CF\u8FF0\u4E86\u7CFB\u7EDF\u7684\u5185\u90E8\u903B\u8F91\u8FC7\u7A0B\uFF0C\u662F\u9700\u6C42\u5206\u6790\u7ED3\u679C\u7684\u8868\u8FBE\u5DE5\u5177\uFF0C\u4E5F\u662F\u7CFB\u7EDF\u8BBE\u8BA1\u7684\u91CD\u8981\u53C2\u8003\u8D44\u6599\uFF0C\u662F\u7CFB\u7EDF\u8BBE\u8BA1\u7684\u8D77\u70B9\u3002 \uFF083\uFF09DFD\u4F5C\u4E3A\u4E00\u4E2A\u5B58\u6863\u7684\u6587\u5B57\u6750\u6599\uFF0C\u662F\u8FDB\u4E00\u6B65\u4FEE\u6539\u548C\u5145\u5B9E\u5F00\u53D1\u8BA1\u5212\u7684\u4F9D\u636E\u3002</p><p><img src="https://img-blog.csdnimg.cn/20210605200701187.png?" alt="img"></p><h2 id="\u9700\u6C42\u5206\u6790\u4E4B\u9762\u5411\u5BF9\u8C61-ooa" tabindex="-1"><a class="header-anchor" href="#\u9700\u6C42\u5206\u6790\u4E4B\u9762\u5411\u5BF9\u8C61-ooa" aria-hidden="true">#</a> \u9700\u6C42\u5206\u6790\u4E4B\u9762\u5411\u5BF9\u8C61 OOA</h2><p><img src="https://img-blog.csdnimg.cn/20210605200728506.png?x-oss-process=image/watermark,type_ZmFuZ3poZW5naGVpdGk,shadow_10,text_aHR0cHM6Ly9ibG9nLmNzZG4ubmV0L3RvcDU0MTk=,size_16,color_FFFFFF,t_70" alt="img"></p><h2 id="\u7C7B\u5C01\u88C5\u7EC4\u6210" tabindex="-1"><a class="header-anchor" href="#\u7C7B\u5C01\u88C5\u7EC4\u6210" aria-hidden="true">#</a> <strong>\u7C7B\u5C01\u88C5\u7EC4\u6210</strong></h2><p>\u5728\u7CFB\u7EDF\u8BBE\u8BA1\u8FC7\u7A0B\u4E2D\uFF0C\u7C7B\u53EF\u4EE5\u5206\u4E3A\u4E09\u79CD\u7C7B\u578B\uFF0C\u5206\u522B\u662F<strong>\u5B9E\u4F53\u7C7B\u3001\u8FB9\u754C\u7C7B\u548C\u63A7\u5236\u7C7B</strong>\u3002</p><blockquote><p>1\u3001<strong>\u5B9E\u4F53\u7C7B</strong>\u5B9E\u4F53\u7C7B\u7684\u4E3B\u8981\u804C\u8D23\u662F\u5B58\u50A8\u548C\u7BA1\u7406\u7CFB\u7EDF\u5185\u90E8\u7684\u4FE1\u606F\uFF0C\u5B83\u4E5F\u53EF\u4EE5\u6709\u884C\u4E3A\uFF0C\u751A\u81F3\u5F88\u590D\u6742\u7684\u884C\u4E3A\uFF0C\u4F46\u8FD9\u4E9B\u884C\u4E3A\u5FC5\u987B\u4E0E\u5B83\u6240\u4EE3\u8868\u7684\u5B9E\u4F53\u5BF9\u8C61\u5BC6\u5207\u76F8\u5173\u3002\u5B9E\u4F53\u7C7B\u6620\u5C04\u9700\u6C42\u4E2D\u7684\u6BCF\u4E2A\u5B9E\u4F53\uFF0C\u5B9E\u4F53\u7C7B\u4FDD\u5B58\u9700\u8981\u5B58\u50A8\u5728\u6C38\u4E45\u5B58\u50A8\u4F53\u4E2D\u7684\u4FE1\u606F\uFF0C\u4F8B\u5982\uFF0C\u5728\u7EBF\u6559\u80B2\u5E73\u53F0\u7CFB\u7EDF\u53EF\u4EE5\u63D0\u53D6\u51FA\u5B66\u5458\u7C7B\u548C\u8BFE\u7A0B\u7C7B\uFF0C\u5B83\u4EEC\u90FD\u5C5E\u4E8E\u5B9E\u4F53\u7C7B\u3002\u5B9E\u4F53\u7C7B\u901A\u5E38\u90FD\u662F\u6C38\u4E45\u6027\u7684\uFF0C\u5B83\u4EEC\u6240\u5177\u6709\u7684\u5C5E\u6027\u548C\u5173\u7CFB\u662F\u957F\u671F\u9700\u8981\u7684\uFF0C\u6709\u65F6\u751A\u81F3\u5728\u7CFB\u7EDF\u7684\u6574\u4E2A\u751F\u5B58\u671F\u90FD\u9700\u8981\u3002</p></blockquote><blockquote><p>2.<strong>\u63A7\u5236\u7C7B</strong>\u63A7\u5236\u7C7B\u7528\u4E8E\u63CF\u8FF0\u4E00\u4E2A\u7528\u4F8B\u6240\u5177\u6709\u7684\u4E8B\u4EF6\u6D41\u63A7\u5236\u884C\u4E3A\uFF0C\u63A7\u5236\u4E00\u4E2A\u7528\u4F8B\u4E2D\u7684\u4E8B\u4EF6\u987A\u5E8F\u3002 \u4F8B\u5982\uFF0C\u7528\u4F8B\u201C\u8EAB\u4EFD\u9A8C\u8BC1\u201D\u53EF\u4EE5\u5BF9\u5E94\u4E8E\u4E00\u4E2A\u63A7\u5236\u7C7B\u201C\u8EAB\u4EFD\u9A8C\u8BC1\u5668\u201D\uFF0C\u5B83\u63D0\u4F9B\u4E86\u4E0E\u8EAB\u4EFD\u9A8C\u8BC1\u76F8\u5173\u7684\u6240\u6709\u64CD\u4F5C\u3002\u63A7\u5236\u7C7B\u7528\u4E8E\u5BF9\u4E00\u4E2A\u6216\u51E0\u4E2A\u7528\u4F8B\u6240\u7279\u6709\u7684\u63A7\u5236\u884C\u4E3A\u8FDB\u884C\u5EFA\u6A21\uFF0C\u63A7\u5236\u5BF9\u8C61\uFF08\u63A7\u5236\u7C7B\u7684\u5B9E\u4F8B\uFF09\u901A\u5E38\u63A7\u5236\u5176\u4ED6\u5BF9\u8C61\uFF0C\u56E0\u6B64\uFF0C\u5B83\u4EEC\u7684\u884C\u4E3A\u5177\u6709\u534F\u8C03\u6027\u3002\u901A\u5E38\u60C5\u51B5\u4E0B\uFF0C\u63A7\u5236\u7C7B\u6CA1\u6709\u5C5E\u6027\uFF0C\u4F46\u4E00\u5B9A\u6709\u65B9\u6CD5\u3002</p></blockquote><blockquote><p>3.<strong>\u8FB9\u754C\u7C7B</strong>\u8FB9\u754C\u7C7B\u7528\u4E8E\u63CF\u8FF0\u5916\u90E8\u53C2\u4E0E\u8005\u4E0E\u7CFB\u7EDF\u4E4B\u95F4\u7684\u4EA4\u4E92\uFF0C\u5B83\u4F4D\u4E8E\u7CFB\u7EDF\u4E0E\u5916\u754C\u7684\u4EA4\u63A5\u5904\uFF0C\u5305\u62EC\u6240\u6709\u7A97\u4F53\u3001\u62A5\u8868\u3001\u6253\u5370\u673A\u548C\u626B\u63CF\u4EEA\u7B49\u786C\u4EF6\u7684\u63A5\u53E3\uFF0C\u4EE5\u53CA\u4E0E\u5176\u4ED6\u7CFB\u7EDF\u7684\u63A5\u53E3\u3002 \u8981\u5BFB\u627E\u548C\u5B9A\u4E49\u8FB9\u754C\u7C7B\uFF0C\u53EF\u4EE5\u68C0\u67E5\u7528\u4F8B\u6A21\u578B\uFF0C\u6BCF\u4E2A\u53C2\u4E0E\u8005\u548C\u7528\u4F8B\u4EA4\u4E92\u81F3\u5C11\u8981\u6709\u4E00\u4E2A\u8FB9\u754C\u7C7B\uFF0C\u8FB9\u754C\u7C7B\u4F7F\u53C2\u4E0E\u8005\u80FD\u4E0E\u7CFB\u7EDF\u4EA4\u4E92\u3002 \u8FB9\u754C\u7C7B\u662F\u4E00\u79CD\u7528\u4E8E\u5BF9\u7CFB\u7EDF\u5916\u90E8\u73AF\u5883\u4E0E\u5176\u5185\u90E8\u8FD0\u4F5C\u4E4B\u95F4\u7684\u4EA4\u4E92\u8FDB\u884C\u5EFA\u6A21\u7684\u7C7B\u3002 \u5E38\u89C1\u7684\u8FB9\u754C\u7C7B\u6709<strong>\u7A97\u53E3\u3001\u901A\u4FE1\u534F\u8BAE\u3001\u6253\u5370\u673A\u63A5\u56D7\u3001\u4F20\u611F\u5668\u548C\u7EC8\u7AEF\u7B49</strong>\u3002\u5B9E\u9645\u4E0A\uFF0C\u5728\u7CFB\u7EDF\u8BBE\u8BA1\u65F6\uFF0C\u4EA7\u751F\u7684\u62A5\u8868\u90FD\u53EF\u4EE5\u4F5C\u4E3A\u8FB9\u754C\u7C7B\u6765\u5904\u7406\u3002</p></blockquote><h2 id="\u7528\u4F8B\u5EFA\u6A21-\u63CF\u8FF0\u7CFB\u7EDF\u9700\u6C42" tabindex="-1"><a class="header-anchor" href="#\u7528\u4F8B\u5EFA\u6A21-\u63CF\u8FF0\u7CFB\u7EDF\u9700\u6C42" aria-hidden="true">#</a> \u7528\u4F8B\u5EFA\u6A21 \u63CF\u8FF0\u7CFB\u7EDF\u9700\u6C42</h2><p>\u5728OOA\u65B9\u6CD5\u4E2D\uFF0C\u6784\u5EFA\u7528\u4F8B\u6A21\u578B\u4E00\u822C\u9700\u8981\u7ECF\u5386\u56DB\u4E2A\u9636\u6BB5\uFF0C\u5206\u522B\u662F<strong>\u8BC6\u522B\u53C2\u4E0E\u8005\u3001\u5408\u5E76\u9700\u6C42\u83B7\u5F97\u7528\u4F8B\u3001\u7EC6\u5316\u7528\u4F8B\u63CF\u8FF0\u548C\u8C03\u6574\u7528\u4F8B\u6A21\u578B</strong>\uFF0C\u5176\u4E2D\u524D\u4E09\u4E2A\u9636\u6BB5\u662F\u5FC5\u9700\u7684\u3002</p><p><img src="https://img-blog.csdnimg.cn/20210512133808864.png" alt="img"></p><p>\u7528\u4F8B\u662F\u4E00\u79CD\u63CF\u8FF0\u7CFB\u7EDF\u9700\u6C42\u7684\u65B9\u6CD5\uFF0C\u4F7F\u7528\u7528\u4F8B\u7684\u65B9\u6CD5\u6765\u63CF\u8FF0\u7CFB\u7EDF\u9700\u6C42\u7684\u8FC7\u7A0B\u5C31\u662F\u7528\u4F8B\u5EFA\u6A21\u3002 \u5728\u7528\u4F8B\u56FE\u4E2D\uFF0C\u4E3B\u8981\u5305\u62EC\u53C2\u4E0E\u8005\u3001\u7528\u4F8B\u548C\u901A\u4FE1\u5173\u8054\u4E09\u79CD\u5143\u7D20\uFF0C\u5982\u4E0A\u56FE\u6240\u793A\u3002 \u901A\u4FE1\u5173\u8054 \u7528\u4F8B \u53C2\u4E0E\u8005 \uFF081\uFF09\u53C2\u4E0E\u8005\u3002\u53C2\u4E0E\u8005\u662F\u6307\u5B58\u5728\u4E8E\u7CFB\u7EDF\u5916\u90E8\u5E76\u4E0E\u7CFB\u7EDF\u8FDB\u884C\u4EA4\u4E92\u7684\u4EFB\u4F55\u4E8B\u7269\uFF0C\u65E2\u53EF\u4EE5\u662F\u4F7F\u7528\u7CFB\u7EDF\u7684\u7528\u6237\uFF0C\u4E5F\u53EF\u4EE5\u662F\u5176\u4ED6\u5916\u90E8\u7CFB\u7EDF\u548C\u8BBE\u5907\u7B49\u5916\u90E8\u5B9E\u4F53\u3002 \uFF082\uFF09\u7528\u4F8B\u3002\u7528\u4F8B\u662F\u5728\u7CFB\u7EDF\u4E2D\u6267\u884C\u7684\u4E00\u7CFB\u5217\u52A8\u4F5C\uFF0C\u8FD9\u4E9B\u52A8\u4F5C\u5C06\u751F\u6210\u7279\u5B9A\u53C2\u4E0E\u8005\u53EF\u89C1\u7684\u4EF7\u503C\u7ED3\u679C\u3002\u4E5F\u5C31\u662F\u8BF4\uFF0C\u7528\u4F8B\u8868\u793A\u7CFB\u7EDF\u6240\u63D0\u4F9B\u7684\u670D\u52A1\uFF0C\u5B83\u5B9A\u4E49\u4E86\u7CFB\u7EDF\u662F\u5982\u4F55\u88AB\u53C2\u4E0E\u8005\u6240\u4F7F\u7528\u7684\uFF0C\u5B83\u63CF\u8FF0\u7684\u662F\u53C2\u4E0E\u8005\u4E3A\u4E86\u4F7F\u7528\u7CFB\u7EDF\u6240\u63D0\u4F9B\u7684\u67D0\u4E00\u5B8C\u6574\u529F\u80FD\u800C\u4E0E\u7CFB\u7EDF\u4E4B\u95F4\u53D1\u751F\u7684\u4E00\u6BB5\u5BF9\u8BDD\u3002 \uFF083\uFF09\u901A\u4FE1\u5173\u8054\u3002\u901A\u4FE1\u5173\u8054\u8868\u793A\u7684\u662F\u53C2\u4E0E\u8005\u548C\u7528\u4F8B\u4E4B\u95F4\u7684\u5173\u7CFB\uFF0C\u6216\u7528\u4F8B\u4E0E\u7528\u4F8B\u4E4B\u95F4\u7684\u5173\u7CFB\u3002\u7BAD\u5934\u8868\u793A\u5728\u8FD9\u4E00\u5173\u7CFB\u4E2D\u54EA\u4E00\u65B9\u662F\u5BF9\u8BDD\u7684\u4E3B\u52A8\u53D1\u8D77\u8005\uFF0C\u7BAD\u5934\u6240\u6307\u65B9\u662F\u5BF9\u8BDD\u7684\u88AB\u52A8\u63A5\u53D7\u8005\uFF0C\u7BAD\u5C3E\u6240\u6307\u65B9\u662F\u5BF9\u8BDD\u7684\u4E3B\u52A8\u53D1\u8D77\u8005\u3002\u5982\u679C\u4E0D\u60F3\u5F3A\u8C03\u5BF9\u8BDD\u4E2D\u7684\u4E3B\u52A8\u4E0E\u88AB\u52A8\u5173\u7CFB\uFF0C\u53EF\u4EE5\u4F7F\u7528\u4E0D\u5E26\u7BAD\u5934\u7684\u5173\u8054\u5B9E\u7EBF\u3002\u5728\u7528\u4F8B\u6A21\u578B\u4E2D\uFF0C\u4FE1\u606F\u6D41\u4E0D\u662F\u7531\u901A\u4FE1\u5173\u8054\u6765\u8868\u793A\u7684\uFF0C\u8BE5\u4FE1\u606F\u6D41\u662F\u9ED1\u9ED8\u4EE5\u5B58\u5728\u7684\uFF0C\u5E76\u4E14\u662F\u53CC\u5411\u7684\uFF0C\u5B83\u4E0E\u7BAD\u5934\u6240\u6307\u7684\u65B9\u5411\u6CA1\u6709\u5173\u7CFB\u3002</p><h3 id="\u4F7F\u7528uml\u5EFA\u6A21" tabindex="-1"><a class="header-anchor" href="#\u4F7F\u7528uml\u5EFA\u6A21" aria-hidden="true">#</a> \u4F7F\u7528UML\u5EFA\u6A21</h3>',35),c=t("\uFF08\u5F15\u7528\u535A\u5BA2 "),d={href:"https://blog.csdn.net/Ellen5203/article/details/83268630?utm_medium=distribute.pc_relevant.none-task-blog-2~default~BlogCommendFromBaidu~default-15.vipsorttest&depth_1-utm_source=distribute.pc_relevant.none-task-blog-2~default~BlogCommendFromBaidu~default-15.vipsorttest",target:"_blank",rel:"noopener noreferrer"},h=t("UML\u662F\u4EC0\u4E48\uFF1F"),m=t(" \u539F\u6587\u94FE\u63A5\uFF1Ahttps://blog.csdn.net/Ellen5203/article/details/83268630\uFF09"),u=o('<p>\u7EDF\u4E00\u5EFA\u6A21\u8BED\u8A00\uFF08Unified Modeling Language\u2014\u2014UML\uFF09\u662F\u4E00\u79CD\u9762\u5411\u5BF9\u8C61\u7684\u5EFA\u6A21\u8BED\u8A00\uFF0C\u5B83\u53EF\u4EE5\u5B9E\u73B0\u5927\u578B\u590D\u6742\u7CFB\u7EDF\u5404\u79CD\u6210\u5206\u63CF\u8FF0\u7684\u53EF\u89C6\u5316\u3001\u8BF4\u660E\u5E76\u6784\u9020\u7CFB\u7EDF\u6A21\u578B\uFF0C\u4EE5\u53CA\u5EFA\u7ACB\u5404\u79CD\u6240\u9700\u7684\u6587\u6863\uFF0C\u662F\u4E00\u79CD\u5B9A\u4E49\u826F\u597D\u3001\u6613\u4E8E\u8868\u8FBE\u3001\u529F\u80FD\u5F3A\u5927\u4E14\u666E\u904D\u9002\u7528\u7684\u5EFA\u6A21\u8BED\u8A00\u3002</p><p><strong>UML\u7EC4\u6210\uFF1A</strong></p><p><img src="https://img-blog.csdnimg.cn/20210513155836796.png?" alt="img"> <img src="https://img-blog.csdnimg.cn/20210513155904542.png?" alt="img"></p><p><strong>UML\u57FA\u672C\u5185\u5BB9\u8BE6\u8FF0</strong><strong>\uFF081\uFF09\u89C6\u56FE</strong> \u89C6\u56FE\u662F\u8868\u8FBE\u7CFB\u7EDF\u7684\u67D0\u4E00\u65B9\u9762\u7279\u5F81\u7684UML\u5EFA\u6A21\u5143\u7D20\u7684\u5B50\u96C6\uFF1B\u89C6\u56FE\u5E76\u4E0D\u662F\u56FE\uFF0C\u5B83\u662F<strong>\u7531\u4E00\u4E2A\u6216\u591A\u4E2A\u56FE\u7EC4\u6210\u7684\u5BF9\u7CFB\u7EDF\u67D0\u4E2A\u89D2\u5EA6\u7684\u62BD\u8C61</strong>\u3002</p><ul><li>\u7528\u4F8B\u89C6\u56FE\uFF1A\u2003\u6838\u5FC3\u89C6\u56FE\u5F3A\u8C03\u4ECE\u7528\u6237\u7684\u89D2\u5EA6\u770B\u5230\u7684\u6216\u9700\u8981\u7684\u7CFB\u7EDF\u529F\u80FD\u3002</li><li>\u903B\u8F91\u89C6\u56FE\uFF1A\u2003\u8BE5\u89C6\u56FE\u7528\u4E8E\u63CF\u8FF0\u7CFB\u7EDF\u5185\u5B9E\u73B0\u7684\u903B\u8F91\u529F\u80FD\uFF0C\u5C55\u73B0\u7CFB\u7EDF\u7684\u9759\u6001\u6216\u7ED3\u6784\u7EC4\u6210\u53CA\u7279\u5F81\u3002</li><li>\u7EC4\u4EF6\u89C6\u56FE\uFF1A\u2003\u8BE5\u89C6\u56FE\u4ECE\u7CFB\u7EDF\u5B9E\u73B0\u7684\u89D2\u5EA6\u6765\u63CF\u8FF0\u6A21\u578B\u5BF9\u8C61\u95F4\u7684\u5173\u7CFB\u3002</li><li>\u914D\u7F6E\u89C6\u56FE\uFF1A\u2003\u8BE5\u89C6\u56FE\u7528\u4E8E\u8BF4\u660E\u7CFB\u7EDF\u7684\u7269\u7406\u914D\u7F6E\u3002</li></ul><p><strong>\uFF082\uFF09\u56FE\u8868</strong> \u56FE\u8868\u662F\u63CF\u8FF0\u89C6\u56FE\u5185\u5BB9\u7684\u56FE\u3002 <strong>1\uFF09\u7528\u4F8B\u56FE</strong>\uFF1A\u7528\u4E8E\u63CF\u8FF0\u5916\u90E8\u9879\u4E0E\u7CFB\u7EDF\u63D0\u4F9B\u7684\u4F7F\u7528\u4E8B\u4EF6\u4E4B\u95F4\u7684\u8054\u7CFB, \u7528\u4F8B\u56FE\u63CF\u8FF0\u4E00\u7EC4\u7528\u4F8B\u3001\u53C2\u4E0E\u8005\u53CA\u5B83\u4EEC\u4E4B\u95F4\u7684\u5173\u7CFB\u3002<strong>\u7528\u6237\u89D2\u5EA6\u63CF\u8FF0\u7CFB\u7EDF\u529F\u80FD</strong>\uFF1B\u53C2\u4E0E\u8005\u662F\u5916\u90E8\u89E6\u53D1\u56E0\u7D20\uFF1B\uFF08\u5305\u62EC\u7528\u6237\u3001\u7EC4\u7EC7\u3001\u5916\u90E8\u7CFB\u7EDF\uFF0C\u65F6\u95F4\uFF09\u7528\u4F8B\u662F\u529F\u80FD\u5355\u5143\u3002</p><p><strong>2\uFF09\u7C7B\u56FE</strong>\uFF1A\u2003\u7528\u4E8E\u63CF\u8FF0\u7CFB\u7EDF\u7684\u9759\u6001\u7ED3\u6784\u3002\u7C7B\u53EF\u4EE5\u7528\u4E0D\u540C\u65B9\u5F0F\u8FDE\u63A5\uFF0C\u4E3B\u8981\u5305\u62EC\u8054\u5408\u3001\u4F9D\u8D56\u3001\u72EC\u7ACB\u548C\u5305\u88C5\u3002\u4E00\u4E2A\u7CFB\u7EDF\u4E00\u822C\u6709\u591A\u5F20\u7C7B\u56FE\uFF0C\u4E00\u4E2A\u7C7B\u53EF\u5728\u4E0D\u540C\u7684\u89C6\u56FE\u4E2D\u51FA\u73B0\u3002</p><p><strong>3\uFF09\u5BF9\u8C61\u56FE</strong>\uFF1A\u7528\u4E8E\u8868\u8FF0\u7CFB\u7EDF\u5728\u67D0\u4E2A\u65F6\u523B\u7684\u9759\u6001\u7ED3\u6784\u3002\u5BF9\u8C61\u56FE\u4E5F\u53EF\u4F5C\u4E3A\u534F\u4F5C\u56FE\u7684\u4E00\u90E8\u5206\uFF0C\u8BF4\u660E\u4E00\u7EC4\u5BF9\u8C61\u4E4B\u95F4\u7684\u52A8\u6001\u534F\u4F5C\u5173\u7CFB\u3002 \u5BF9\u8C61\u56FE\u4E0E\u7C7B\u56FE\u7684\u533A\u522B\uFF1A\u5BF9\u8C61\u56FE\u8868\u793A\u7684\u662F\u7C7B\u4E2D\u7684\u8BB8\u591A\u5BF9\u8C61\u5B9E\u4F8B\uFF0C\u800C\u4E0D\u662F\u7C7B\u672C\u8EAB\u3002</p><p>**4\uFF09\u72B6\u6001\u56FE\uFF1A**\u7528\u4E8E\u8BF4\u660E\u7C7B\u4E2D\u7684\u5BF9\u8C61\u53EF\u80FD\u5177\u6709\u7684\u72B6\u6001\uFF0C\u4EE5\u53CA\u7531\u65F6\u95F4\u5F15\u8D77\u7684\u72B6\u6001\u7684\u6539\u53D8\u3002 \u7B80\u5355\u7406\u89E3\uFF1A\u63CF\u8FF0\u4E86\u7CFB\u7EDF\u5143\u7D20\u7684\u72B6\u6001\u6761\u4EF6\u548C\u54CD\u5E94\u3002</p><p><img src="https://img2020.cnblogs.com/blog/2452044/202110/2452044-20211012133225494-1935753136.png" alt="img"></p><p><strong>5\uFF09\u987A\u5E8F\u56FE\uFF08\u65F6\u5E8F\u56FE\uFF09</strong>\uFF1A\u7528\u4E8E\u63CF\u8FF0\u5BF9\u8C61\u95F4\u7684\u52A8\u6001\u534F\u4F5C\u5173\u7CFB\u3002\u8868\u8FBE\u4E86\u5BF9\u8C61\u95F4\u53D1\u884C\u6D88\u606F\u7684\u65F6\u5E8F\uFF0C\u540C\u65F6\u4E5F\u8868\u8FBE\u51FA\u5BF9\u8C61\u95F4\u7684\u76F8\u4E92\u4F5C\u7528\uFF0C\u4EE5\u53CA\u5F53\u7CFB\u7EDF\u6267\u884C\u5230\u67D0\u4E2A\u7279\u5B9A\u4F4D\u7F6E\u65F6\u53EF\u80FD\u4F1A\u53D1\u751F\u7684\u4E8B\u3002 \u7B80\u5355\u7406\u89E3\uFF1A<strong>\u6309\u65F6\u95F4\u987A\u5E8F\u63CF\u8FF0\u7CFB\u7EDF\u5143\u7D20\u95F4\u7684\u4EA4\u4E92</strong>\u3002</p><p><img src="https://img2020.cnblogs.com/blog/2452044/202110/2452044-20211012133357189-1681427803.png" alt="img"></p><p>**6\uFF09\u534F\u4F5C\u56FE\uFF08\u901A\u4FE1\u56FE\uFF09\uFF1A**\u6309\u7167\u65F6\u95F4\u548C\u7A7A\u95F4\u987A\u5E8F\u63CF\u8FF0\u7CFB\u7EDF\u5143\u7D20\u95F4\u7684\u4EA4\u4E92\u548C\u5B83\u4EEC\u4E4B\u95F4\u7684\u5173\u7CFB\u3002\u662F\u4E00\u79CD\u4EA4\u4E92\u56FE\uFF0C\u5B83\u5F3A\u8C03\u6536\u53D1\u6D88\u606F\u7684\u5BF9\u8C61\u6216\u53C2\u4E0E\u7684\u7EC4\u7EC7\u7ED3\u6784\u3002</p><p>\u4E0E\u987A\u5E8F\u56FE\u7684\u533A\u522B\uFF1A\u987A\u5E8F\u56FE\u5F3A\u8C03\u7684\u662F\u65F6\u5E8F\u901A\u4FE1\u56FE\u5F3A\u8C03\u7684\u662F\u5BF9\u8C61\u4E4B\u95F4\u7684<strong>\u7EC4\u7EC7\u7ED3\u6784</strong>\uFF08\u5173\u7CFB\uFF09</p><p><img src="https://img2020.cnblogs.com/blog/2452044/202110/2452044-20211012133126754-1284806748.png" alt="img"></p><p>**7\uFF09\u6D3B\u52A8\u56FE\uFF1A**\u7528\u4E8E\u63CF\u8FF0\u7CFB\u7EDF\u6D3B\u52A8\u7684\u6D41\u7A0B\u3002<strong>\u6D3B\u52A8\u56FE\u7531\u6D3B\u52A8\u72B6\u6001\u7EC4\u6210</strong>\uFF0C\u5B83\u5305\u542B\u5C06\u5B8C\u6210\u7684\u6D3B\u52A8\u7684\u8BF4\u660E\u3002\u5F53\u4E00\u4E2A\u52A8\u4F5C\u5B8C\u6210\u65F6\uFF0C\u6FC0\u53D1\u4E00\u4E2A\u660E\u786E\u7684\u4E8B\u4EF6\u5E76\u8F6C\u5230\u4E00\u4E2A\u65B0\u7684\u72B6\u6001\u3002\u5B83\u53EF\u4EE5\u63CF\u8FF0\u5E76\u884C\u6267\u884C\u7684\u6D3B\u52A8\u3002\u53E6\u5916\uFF0C\u5B83\u8FD8\u5305\u62EC\u4E86\u5F53\u52A8\u4F5C\u90E8\u5206\u5B8C\u6210\u65F6\u6536\u5230\u6216\u53D1\u51FA\u7684\u6D88\u606F\u7684\u8BF4\u660E\u3002 \u7B80\u5355\u7406\u89E3\uFF1A\u672C\u8D28\u4E0A\u662F\u6D41\u7A0B\u56FE\uFF0C\u63CF\u8FF0\u7CFB\u7EDF\u7684\u6267\u884C\u987A\u5E8F\u3002</p><p><img src="https://img2020.cnblogs.com/blog/2452044/202110/2452044-20211012133517912-504244168.png" alt="img"></p><p><strong>8\uFF09\u6784\u5EFA\u56FE\uFF0C\u7EC4\u4EF6\u56FE\uFF1A<strong>\u7528\u4E8E\u63CF\u8FF0</strong>\u7EC4\u4EF6\u4EE3\u7801\u7684\u7269\u7406\u7ED3\u6784</strong>\u3002\u5B83\u5EFA\u7ACB\u4E86\u4E00\u4E2A\u4ECE\u903B\u8F91\u89C6\u56FE\u5230\u7269\u7406\u89C6\u56FE\u7684\u6620\u5C04\u3002\u540C\u65F6\uFF0C\u5B83\u8FD8\u63CF\u8FF0\u4E86\u7EC4\u4EF6\u7684\u4F9D\u8D56\u5173\u7CFB\uFF0C\u53EF\u4EE5\u7528\u6765\u5206\u6790\u4E00\u4E2A\u7EC4\u4EF6\u7684\u53D8\u5316\u5BF9\u53E6\u4E00\u4E2A\u7EC4\u4EF6\u6240\u4EA7\u751F\u7684\u5F71\u54CD\u3002</p><p><strong>9\uFF09\u914D\u7F6E\u56FE</strong> \u2003\u2003\u7528\u4E8E\u63CF\u8FF0\u7CFB\u7EDF\u4E2D\u8F6F\u4EF6\u548C\u786C\u4EF6\u7684\u7269\u7406\u7ED3\u6784\u3002</p><p><strong>10\uFF09\u72B6\u6001\u56FE</strong></p><p><strong>11\uFF09\u5B9A\u65F6\u56FE</strong></p><p>\u5B9A\u65F6\u56FE\u662F\u4E00\u79CD\u65B0\u589E\u7684\u3001\u7279\u522B\u9002\u5408\u5B9E\u65F6\u548C\u5D4C\u5165\u5F0F\u7CFB\u7EDF\u5EFA\u6A21\u7684\u4EA4\u4E92\u56FE\uFF0C\u4E5F\u79F0\u4E3A<strong>\u8BA1\u65F6\u56FE</strong>\uFF0C\u8BA1\u65F6\u56FE\u5173\u6CE8\u6CBF\u7740\u7EBF\u6027\u65F6\u95F4\u8F74\u3001\u751F\u547D\u7EBF\u5185\u90E8\u548C\u751F\u547D\u7EBF\u4E4B\u95F4\u7684\u6761\u4EF6\u6539\u53D8\u3002\u5B83\u63CF\u8FF0\u5BF9\u8C61\u72B6\u6001\u968F\u7740\u65F6\u95F4\u6539\u53D8\u7684\u60C5\u51B5\uFF0C\u5F88\u50CF\u793A\u6CE2\u5668\uFF0C\u9002\u5408\u5206\u6790\u5468\u671F\u548C\u975E\u5468\u671F\u6027\u4EFB\u52A1\u3002 \u5B9A\u65F6\u56FE\u5F3A\u8C03\u6D88\u606F\u8DE8\u8D8A\u4E0D\u540C\u5BF9\u8C61\u6216\u53C2\u4E0E\u8005\u7684\u5B9E\u9645\u65F6\u95F4\uFF0C\u800C\u4E0D\u4EC5\u4EC5\u5173\u5FC3\u6D88\u606F\u7684\u76F8\u5BF9\u987A\u5E8F\u3002</p><p><strong>12\uFF09\u90E8\u7F72\u56FE</strong></p><p>\u8F6F\u786C\u4EF6\u4E4B\u95F4\u6620\u5C04</p><p><strong>12\uFF094+1 \u89C6\u56FE \u9700\u6C42\u5206\u6790\u6A21\u578B</strong>\uFF1A \u903B\u8F91\u89C6\u56FE\uFF08\u7C7B\u4E0E\u5BF9\u8C61\uFF09 -&gt; \u5B9E\u73B0\u89C6\u56FE\uFF08\u7269\u7406\u4EE3\u7801\u4E0E\u6587\u4EF6\uFF09 -&gt; \u90E8\u7F72\u89C6\u56FE\uFF08\u8F6F\u4EF6\u5230\u786C\u4EF6\u7684\u6620\u5C04\uFF09 -&gt; \u8FDB\u7A0B\u89C6\u56FE\uFF08\u7EBF\u7A0B\uFF0C\u8FDB\u7A0B\uFF0C\u5E76\u53D1\uFF09 \u56F4\u7ED5 \u7528\u4F8B\u89C6\u56FE</p><p>\u200B <strong>\u8F6F\u4EF6\u4F53\u7CFB\u7ED3\u6784</strong>\u3002\u201C4+1\u201D\u89C6\u56FE\u6A21\u578B\u4ECE5\u4E2A\u4E0D\u540C\u7684\u89C6\u89D2\u5305\u62EC\u903B\u8F91\u89C6\u56FE\u3001\u8FDB\u7A0B\u89C6\u56FE\u3001\u7269\u7406\u89C6\u56FE\u3001\u5F00\u53D1\u89C6\u56FE\u548C\u573A\u666F\u89C6\u56FE\u6765\u63CF\u8FF0\u8F6F\u4EF6\u4F53\u7CFB\u7ED3\u6784\u3002</p><p><img src="https://img-blog.csdnimg.cn/20210513165408891.png?" alt="img"></p><p>\u6A21\u578B\u5143\u7D20 \u2003\u2003\u6A21\u578B\u5143\u7D20\u4EE3\u8868\u9762\u5411\u5BF9\u8C61\u4E2D\u7684\u7C7B\u3001\u5BF9\u8C61\u3001\u63A5\u53E3\u3001\u6D88\u606F\u548C\u5173\u7CFB\u7B49\u6982\u5FF5\u3002UML\u4E2D\u7684\u6A21\u578B\u5143\u7D20\u5305\u62EC\u4E8B\u7269\u548C\u4E8B\u7269\u4E4B\u95F4\u7684\u8054\u7CFB\uFF0C\u5E38\u89C1\u7684\u8054\u7CFB\u5305\u62EC\u5173\u8054\u5173\u7CFB\u3001\u4F9D\u8D56\u5173\u7CFB\u3001\u6CDB\u5316\u5173\u7CFB\u3001\u5B9E\u73B0\u5173\u7CFB\u548C\u805A\u5408\u5173\u7CFB\u3002 \u57FA\u672C\u673A\u5236 \u2003\u2003UML\u7684\u57FA\u672C\u673A\u5236\u8868\u73B0\u4E3A\u5404\u79CD\u56FE\u6807\u4E0A\u7684\u9644\u52A0\u4FE1\u606F\uFF0C\u7528\u4E8E\u63CF\u8FF0\u90A3\u4E9B\u6A21\u578B\u5143\u7D20\u65E0\u6CD5\u8868\u8FBE\u7684\u5185\u5BB9\u3002 1\uFF09\u4FEE\u9970 \u2003\u2003\u901A\u8FC7\u7279\u5B9A\u7684\u4FEE\u9970\u628A\u4E00\u4E9B\u8BED\u4E49\u52A0\u5230\u6A21\u578B\u5143\u7D20\u4E0A\u3002 2\uFF09\u6CE8\u91CA \u2003\u2003UML\u63D0\u4F9B\u589E\u52A0\u6CE8\u91CA\u7684\u65B9\u5F0F\u4EE5\u8868\u8FBE\u90A3\u4E9B\u6A21\u578B\u5143\u7D20\u65E0\u6CD5\u8868\u793A\u7684\u4FE1\u606F\u3002 3\uFF09\u8BF4\u660E \u2003\u2003\u7528\u4E8E\u589E\u52A0\u65E0\u6CD5\u6B63\u5F0F\u5728\u56FE\u4E2D\u8868\u793A\u7684\u5143\u7D20\u5B9E\u4F8B\u7684\u9644\u52A0\u8BF4\u660E\uFF0C\u53EF\u4EE5\u7531\u6587\u672C\u7684\u5F62\u5F0F\u5BF9\u56FE\u4E2D\u76F8\u5E94\u90E8\u5206\u7684\u8D23\u4EFB\u548C\u6743\u9650\u52A0\u4EE5\u8BF4\u660E\u3002</p><p>\u89C4\u5219\u662F\u6784\u9020\u5757\u5982\u4F55\u653E\u5728\u4E00\u8D77\u7684\u89C4\u5B9A\uFF0C\u5305\u62EC\u4E3A\u6784\u9020\u5757\u547D\u540D\uFF1B\u7ED9\u4E00\u4E2A\u540D\u5B57\u4EE5\u7279\u5B9A\u542B\u4E49\u7684\u8BED\u5883\uFF0C\u5373\u8303\u56F4\uFF1B\u600E\u6837\u4F7F\u7528\u6216\u770B\u89C1\u540D\u5B57\uFF0C\u5373\u53EF\u89C1\u6027\uFF1B\u4E8B\u7269\u5982\u4F55\u6B63\u786E\u3001\u4E00\u81F4\u5730\u76F8\u4E92\u8054\u7CFB\uFF0C\u5373\u5B8C\u6574\u6027\uFF1B\u8FD0\u884C\u6216\u6A21\u62DF\u52A8\u6001\u6A21\u578B\u7684\u542B\u4E49\u662F\u4EC0\u4E48\uFF0C\u5373\u6267\u884C\u3002 \u516C\u5171\u673A\u5236\u662F\u6307\u8FBE\u5230\u7279\u5B9A\u76EE\u6807\u7684\u516C\u5171UML\u65B9\u6CD5\uFF0C\u4E3B\u8981\u5305\u62EC\u89C4\u683C\u8BF4\u660E\uFF08\u8BE6\u7EC6\u8BF4\u660E\uFF09\u3001\u4FEE\u9970\u3001\u516C\u5171\u5206\u7C7B\uFF08\u901A\u7528\u5212\u5206\uFF09\u548C\u6269\u5C55\u673A\u52364\u79CD\u3002\u89C4\u683C\u8BF4\u660E\u662F\u4E8B\u7269\u8BED\u4E49\u7684\u7EC6\u8282\u63CF\u8FF0\uFF0C\u5B83\u662F\u6A21\u578B\u771F\u6B63\u7684\u6838\u5FC3\u3002</p><p><strong>UML\u5728\u9700\u6C42\u5206\u6790\u4E2D\u7684\u4F7F\u7528\uFF1A</strong></p><p><img src="https://img-blog.csdnimg.cn/20210513154805578.png?" alt="img"></p><p><img src="https://img-blog.csdnimg.cn/20210605194622853.png?" alt="img"></p><p>UML\u6709\u4E09\u79CD\u57FA\u672C\u7684\u6784\u9020\u5757\uFF0C\u5206\u522B\u662F\u4E8B\u7269\uFF08thing\uFF09\u3001\u5173\u7CFB\uFF08relationship\uFF09\u548C\u56FE\uFF08diagram\uFF09\u3002\u4E8B\u7269\u662FUML\u7684\u91CD\u8981\u7EC4\u6210\u90E8\u5206\uFF0C\u5173\u7CFB\u628A\u4E8B\u7269\u7D27\u5BC6\u8054\u7CFB\u5728\u4E00\u8D77\uFF0C\u56FE\u662F\u591A\u4E2A\u76F8\u4E92\u5173\u8054\u7684\u4E8B\u7269\u7684\u96C6\u5408\u3002</p><p>UML\u7528<strong>\u5173\u7CFB</strong>\u628A\u4E8B\u7269\u7ED3\u5408\u5728\u4E00\u8D77\uFF0C\u4E3B\u8981\u6709\u4E0B\u5217\u56DB\u79CD\u5173\u7CFB\uFF1A</p><ol><li>\u4F9D\u8D56\uFF08Dependency\uFF09\u3002\u4F9D\u8D56\u662F\u4E24\u4E2A\u4E8B\u7269\u4E4B\u95F4\u7684\u8BED\u4E49\u5173\u7CFB\uFF0C\u5176\u4E2D\u4E00\u4E2A\u4E8B\u7269\u53D1\u751F\u53D8\u5316\u4F1A\u5F71\u54CD\u53E6\u4E00\u4E2A\u4E8B\u7269\u7684\u8BED\u4E49\u3002</li><li>\u5173\u8054\uFF08Association\uFF09\u3002\u5173\u8054\u63CF\u8FF0\u4E00\u7EC4\u5BF9\u8C61\u4E4B\u95F4\u8FDE\u63A5\u7684\u7ED3\u6784\u5173\u7CFB\u3002 \u3000\u3000\u805A\u5408\u5173\u7CFB\uFF1A\u6574\u4F53\u4E0E\u90E8\u5206\u751F\u547D\u5468\u671F\u4E0D\u540C\uFF1B<br> \u7EC4\u5408\u5173\u7CFB\uFF1A\u6574\u4F53\u4E0E\u90E8\u5206\u751F\u547D\u5468\u671F\u76F8\u540C\uFF1B</li><li>\u6CDB\u5316\u662F\u4E00\u822C\u5316\u548C\u7279\u6B8A\u5316\u7684\u5173\u7CFB\uFF0C\u63CF\u8FF0\u7279\u6B8A\u5143\u7D20\u7684\u5BF9\u8C61\u53EF\u66FF\u6362\u4E00\u822C\u5143\u7D20\u7684\u5BF9\u8C61\u3002</li><li>\u5B9E\u73B0\uFF08Realization\uFF09\u3002\u5B9E\u73B0\u662F\u7C7B\u4E4B\u95F4\u7684\u8BED\u4E49\u5173\u7CFB\uFF0C\u5176\u4E2D\u7684\u4E00\u4E2A\u7C7B\u6307\u5B9A\u4E86\u7531\u53E6\u4E00\u4E2A\u7C7B\u4FDD\u8BC1\u6267\u884C\u7684\u5951\u7EA6\u3002</li></ol><p><img src="https://img2020.cnblogs.com/blog/2452044/202110/2452044-20211012132427239-1737205536.png" alt="img"></p><p><img src="https://img2020.cnblogs.com/blog/2452044/202110/2452044-20211021200422471-2038950435.png" alt="img"></p><p><strong>UML2.0</strong></p><p>\uFF081\uFF09\u7EC4\u5408\u7ED3\u6784\u56FE\u63CF\u8FF0\u7ED3\u6784\u5316\u7C7B\uFF08\u4F8B\u5982\uFF0C\u6784\u4EF6\u6216\u7C7B\uFF09\u7684\u5185\u90E8\u7ED3\u6784\uFF0C\u5305\u62EC\u7ED3\u6784\u5316\u7C7B\u4E0E\u7CFB\u7EDF\u5176\u4F59\u90E8\u5206\u7684\u4EA4\u4E92\u70B9\u3002\u7EC4\u5408\u7ED3\u6784\u56FE\u7528\u4E8E\u753B\u51FA\u7ED3\u6784\u5316\u7C7B\u7684\u5185\u90E8\u5185\u5BB9\u3002 \uFF082\uFF09\u5B9A\u65F6\u56FE\u4E5F\u79F0\u8BA1\u65F6\u56FE\uFF0C\u5B9A\u65F6\u56FE\u4E5F\u662F\u4E00\u79CD\u4EA4\u4E92\u56FE\uFF0C\u5B83\u5F3A\u8C03\u6D88\u606F\u8DE8\u8D8A\u4E0D\u540C\u5BF9\u8C61\u6216\u53C2\u4E0E\u8005\u7684\u5B9E\u9645\u65F6\u95EE\uFF0C\u800C\u4E0D\u4EC5\u4EC5\u53EA\u662F\u5173\u5FC3\u6D88\u606F\u7684\u76F8\u5BF9\u987A\u5E8F\u3002 \uFF083\uFF09\u5236\u54C1\u56FE\u63CF\u8FF0\u8BA1\u7B97\u673A\u4E2D\u4E00\u4E2A\u7CFB\u7EDF\u7684\u7269\u7406\u7ED3\u6784\u3002\u5236\u54C1\u5305\u62EC\u6587\u4EF6\u3001\u6570\u636E\u5E93\u548C\u7C7B\u4F3C\u7684\u7269\u7406\u6BD4\u7279\u96C6\u5408\u3002\u5236\u54C1\u56FE\u901A\u5E38\u4E0E\u90E8\u7F72\u56FE\u4E00\u8D77\u4F7F\u7528\u3002\u5236\u54C1\u4E5F\u7ED9\u51FA\u4E86\u5B83\u4EEC\u5B9E\u73B0\u7684\u7C7B\u548C\u6784\u4EF6\u3002 \uFF084\uFF09\u4EA4\u4E92\u6982\u89C8\u56FE\u662F\u6D3B\u52A8\u56FE\u548C\u987A\u5E8F\u56FE\u7684\u6DF7\u5408\u7269\u3002\u5B83\u662F\u6D3B\u52A8\u56FE\u7684\u53D8\u4F53\uFF0C\u63CF\u8FF0\u4E1A\u52A1\u8FC7\u7A0B\u4E2D\u7684\u63A7\u5236\u6D41\u6982\u89C8\uFF0C\u8F6F\u4EF6\u8FC7\u7A0B\u4E2D\u7684\u8BE6\u7EC6\u903B\u8F91\u6982\u89C8\uFF0C\u4EE5\u53CA\u5C06\u591A\u4E2A\u56FE\u8FDB\u884C\u8FDE\u63A5\uFF0C\u62BD\u8C61\u6389\u4E86\u6D88\u606F\u548C\u751F\u547D\u7EBF\u3002</p><h1 id="\u9700\u6C42\u53D8\u66F4" tabindex="-1"><a class="header-anchor" href="#\u9700\u6C42\u53D8\u66F4" aria-hidden="true">#</a> \u9700\u6C42\u53D8\u66F4</h1><p>\u4E00\u4E2A\u5927\u578B\u8F6F\u4EF6\u7CFB\u7EDF\u7684\u9700\u6C42\u901A\u5E38\u662F\u4F1A\u53D1\u751F\u53D8\u5316\u7684\u3002\u5728\u8FDB\u884C\u9700\u6C42\u53D8\u66F4\u65F6\uFF0C\u53EF\u4EE5\u53C2\u8003\u4EE5\u4E0B\u7684\u9700\u6C42\u53D8\u66F4\u7B56\uFF1A</p><p>\uFF081\uFF09\u6240\u6709\u9700\u6C42\u53D8\u66F4\u5FC5\u987B\u9075\u5FAA\u53D8\u66F4\u63A7\u5236\u8FC7\u7A0B\uFF1B \uFF082\uFF09\u5BF9\u4E8E\u672A\u83B7\u5F97\u6279\u51C6\u7684\u53D8\u66F4\uFF0C\u4E0D\u5E94\u8BE5\u505A\u8BBE\u8BA1\u548C\u5B9E\u73B0\u5DE5\u4F5C\uFF1B \uFF083\uFF09\u53D8\u66F4\u5E94\u8BE5\u7531\u9879\u76EE\u53D8\u66F4\u63A7\u5236\u59D4\u5458\u4F1A\u51B3\u5B9A\u5B9E\u73B0\u54EA\u4E9B\u53D8\u66F4\uFF1B \uFF084\uFF09\u9879\u76EE\u98CE\u9669\u627F\u62C5\u8005\u5E94\u8BE5\u80FD\u591F\u4E86\u89E3\u53D8\u66F4\u6570\u636E\u5E93\u7684\u5185\u5BB9\uFF1B \uFF085\uFF09\u51B3\u4E0D\u80FD\u4ECE\u6570\u636E\u5E93\u4E2D\u5220\u9664\u6216\u8005\u4FEE\u6539\u53D8\u66F4\u8BF7\u6C42\u7684\u539F\u59CB\u6587\u6863\uFF1B \uFF086\uFF09\u6BCF\u4E00\u4E2A\u96C6\u6210\u7684\u9700\u6C42\u53D8\u66F4\u5FC5\u987B\u80FD\u8DDF\u8E2A\u5230\u4E00\u4E2A\u7ECF\u6838\u51C6\u7684\u53D8\u66F4\u8BF7\u6C42</p><h1 id="\u9700\u6C42\u7BA1\u7406" tabindex="-1"><a class="header-anchor" href="#\u9700\u6C42\u7BA1\u7406" aria-hidden="true">#</a> \u9700\u6C42\u7BA1\u7406</h1><p>\u9700\u6C42\u7BA1\u7406\u662F\u4E00\u4E2A\u5BF9\u7CFB\u7EDF\u9700\u6C42\u53D8\u66F4\u3001\u4E86\u89E3\u548C\u63A7\u5236\u7684\u8FC7\u7A0B\u3002\u9700\u6C42\u7BA1\u7406\u8FC7\u7A0B\u4E0E\u9700\u6C42\u5F00\u53D1\u8FC7\u7A0B\u76F8\u4E92\u5173\u8054\uFF0C\u5F53\u521D\u59CB\u9700\u6C42\u5BFC\u51FA\u7684\u540C\u65F6\u5C31\u542F\u52A8\u4E86\u9700\u6C42\u7BA1\u7406\u8BA1\u5212\uFF0C\u4E00\u65E6\u5F62\u6210\u4E86\u9700\u6C42\u6587\u6863\u7684\u521D\u7A3F\uFF0C\u9700\u6C42\u7BA1\u7406\u6D3B\u52A8\u5C31\u5F00\u59CB\u4E86\u3002\u5173\u4E8E\u9700\u6C42\u7BA1\u7406\u8FC7\u7A0B\u57DF\u5185\u7684\u539F\u5219\u548C\u7B56\uFF0C\u53EF\u4EE5\u53C2\u8003\uFF1A\u2460\u9700\u6C42\u7BA1\u7406\u7684\u5173\u952E\u8FC7\u7A0B\u9886\u57DF\u4E0D\u6D89\u53CA\u6536\u96C6\u548C\u5206\u6790\u9879\u76EE\u9700\u6C42\uFF0C\u800C\u662F\u5047\u5B9A\u5DF1\u6536\u96C6\u4E86\u8F6F\u4EF6\u9700\u6C42\uFF0C\u6216\u8005\u5DF2\u7531\u66F4\u9AD8\u4E00\u7EA7\u7684\u7CFB\u7EDF\u7ED9\u5B9A\u4E86\u9700\u6C42\u3002\u2461\u5F00\u53D1\u4EBA\u5458\u5728\u5411\u5BA2\u6237\u4EE5\u53CA\u6709\u5173\u90E8\u95E8\u627F\u8BFA\u67D0\u4E9B\u9700\u6C42\u4E4B\u524D\uFF0C\u5E94\u8BE5\u786E\u8BA4\u9700\u6C42\u548C\u7EA6\u675F\u6761\u4EF6\u3001\u98CE\u9669\u3001\u5076\u7136\u56E0\u7D20\u3001\u5047\u5B9A\u6761\u4EF6\u7B49\u3002\u2462\u5173\u952E\u5904\u7406\u9886\u57DF\u540C\u6837\u5EFA\u8BAE\u901A\u8FC7\u7248\u672C\u63A7\u5236\u548C\u53D8\u66F4\u63A7\u5236\u6765\u7BA1\u7406\u9700\u6C42\u6587\u6863\u3002</p>',44);function b(_,f){const s=e("ExternalLinkIcon");return r(),g("div",null,[a,n("p",null,[c,n("a",d,[h,p(s)]),m]),u])}const L=i(l,[["render",b],["__file","re.html.vue"]]);export{L as default};
